import React from 'react';
import MenuIcon from "@material-ui/icons/Menu";
import {Menu, Typography    } from "@material-ui/core";

const Navbar = () => {
    return (
        <div>
            <Typography variant="button">
                <MenuIcon />
            </Typography>
            <Menu>
                <Menu.Item>
                    HeadLines
                </Menu.Item>
            </Menu>
        </div>
    )
}

export default Navbar
